import {Injectable} from '@angular/core';
import {Action, NgxsOnInit, Selector, State, StateContext} from '@ngxs/store';
import {
  AuthLogOutAction,
  AuthSignInAction,
  AuthSignInFailedEvent,
  AuthSignInSucceededEvent,
  AuthSignUpAction,
  AuthSignUpFailedEvent,
  AuthSignUpSucceededEvent,
  IAuthState,
} from './auth.state-models';
import {ProfileService} from '../../service/profile.service';
import {catchError, map, mergeMap, of, tap} from 'rxjs';
import {Navigate} from '@ngxs/router-plugin';
import {ProfileConfiguredSuccessfullyEvent, ProfileLoadedEvent} from '../domain/domain.state-models';
import * as fromRoutes from '../../commons/routes';
import {LocalStoreService} from '../../service/local-store.service';
import {UnknownBoolean} from '../../commons/models/common.models';
import {IAccount} from '../../commons/models/auth.models';


@State<IAuthState>({
  name: 'auth',
  defaults: {
    profileConfigured: UnknownBoolean.UNKNOWN,
    loggedIn: UnknownBoolean.UNKNOWN,
    token: null,
    account: null,
  },
})
@Injectable()
export class AuthState implements NgxsOnInit {
  constructor(private profileService: ProfileService,
              private localStoreService: LocalStoreService) {
  }

  @Selector()
  static token(state: IAuthState): string | null {
    return state.token;
  }

  @Selector()
  static profileConfigured(state: IAuthState): UnknownBoolean {
    return state.loggedIn.and(state.profileConfigured);
  }

  @Selector()
  static isAuthenticated(state: IAuthState): UnknownBoolean {
    return state.loggedIn;
  }

  @Selector()
  static account(state: IAuthState): IAccount | null {
    return state.account;
  }

  ngxsOnInit(ctx: StateContext<IAuthState>): void {
    const token = this.localStoreService.loadJwtToken();
    if (token == null) {
      ctx.patchState({
        loggedIn: UnknownBoolean.FALSE,
      });
      return;
    }

    this.profileService.getProfile().pipe(
      tap(profile => {
        ctx.patchState({
          loggedIn: UnknownBoolean.TRUE,
          token: token,
        });

        if (profile.profileConfigured) {
          ctx.dispatch(new Navigate([fromRoutes.dashboard]));
        } else {
          ctx.dispatch(new Navigate([fromRoutes.completeProfile]));
        }
      }),
      map(profile => new ProfileLoadedEvent(profile)))
      .subscribe(ctx.dispatch);
  }

  @Action(AuthLogOutAction)
  handleAuthLogOutAction(ctx: StateContext<IAuthState>, action: AuthLogOutAction) {
    ctx.patchState({
      token: null,
      loggedIn: UnknownBoolean.FALSE,
      profileConfigured: UnknownBoolean.UNKNOWN,
      account: null,
    });
  }

  @Action(AuthSignInAction)
  signIn(ctx: StateContext<IAuthState>, action: AuthSignInAction) {
    return this.profileService.signIn(action.email, action.password)
      .pipe(
        mergeMap(rsp => of(
          new ProfileLoadedEvent(rsp),
          new AuthSignInSucceededEvent(rsp.token, rsp.profileConfigured, rsp.account),
        )),
        catchError(err => of(new AuthSignInFailedEvent(err.message ?? 'Sign in failed'))),
        map(ctx.dispatch),
      );
  }

  @Action(AuthSignInSucceededEvent)
  signInSucceeded(ctx: StateContext<IAuthState>, action: AuthSignInSucceededEvent) {
    ctx.patchState({
      token: action.token,
      loggedIn: UnknownBoolean.TRUE,
      profileConfigured: action.isProfileConfigured ? UnknownBoolean.TRUE : UnknownBoolean.FALSE,
      account: action.account,
    });

    this.localStoreService.saveJwtToken(action.token);

    return action.isProfileConfigured ? ctx.dispatch(new Navigate(['/'])) : ctx.dispatch(new Navigate([`/${fromRoutes.completeProfile}`]));
  }

  @Action(AuthSignInFailedEvent)
  handleSignInFailed(ctx: StateContext<IAuthState>, action: AuthSignInFailedEvent) {
    console.warn(action.msg);

    ctx.patchState({
      token: null,
      loggedIn: UnknownBoolean.FALSE,
      profileConfigured: UnknownBoolean.FALSE,
    });
  }

  @Action(AuthSignUpAction)
  signUp(ctx: StateContext<IAuthState>, action: AuthSignUpAction) {
    return this.profileService.signUp(action.email, action.password)
      .pipe(
        map(rsp => new AuthSignUpSucceededEvent(rsp.token)),
        catchError(err => of(new AuthSignUpFailedEvent(err.message))),
        map(ctx.dispatch),
      );
  }

  @Action(AuthSignUpSucceededEvent)
  handleSignUpSuccess(ctx: StateContext<IAuthState>, action: AuthSignUpSucceededEvent) {
    ctx.patchState({
      token: action.token,
      loggedIn: UnknownBoolean.TRUE,
      profileConfigured: UnknownBoolean.FALSE,
    });

    this.localStoreService.saveJwtToken(action.token);

    return ctx.dispatch(new Navigate([`/${fromRoutes.completeProfile}`]));
  }

  @Action(AuthSignUpFailedEvent)
  handleSignUpFailed(ctx: StateContext<IAuthState>, action: AuthSignUpFailedEvent) {
    console.warn(action.msg);

    ctx.patchState({
      token: null,
      loggedIn: UnknownBoolean.FALSE,
      profileConfigured: UnknownBoolean.FALSE,
    });
  }

  @Action(ProfileConfiguredSuccessfullyEvent)
  handleProfileConfigured(ctx: StateContext<IAuthState>, action: ProfileConfiguredSuccessfullyEvent) {
    if (ctx.getState().loggedIn) {
      ctx.patchState({
        profileConfigured: UnknownBoolean.TRUE,
      });

      return ctx.dispatch(new Navigate(['/']));
    }
    return null;
  }

  @Action(ProfileLoadedEvent)
  handleProfileLoadedEvent(ctx: StateContext<IAuthState>, action: ProfileLoadedEvent) {
    ctx.patchState({
      profileConfigured: action.profile.profileConfigured ? UnknownBoolean.TRUE : UnknownBoolean.FALSE,
    });
  }
}

import {Action, Selector, State, StateContext} from '@ngxs/store';
import {
  ConfigureProfileAction,
  IDomainState,
  MealRemovedSuccessfullyEvent,
  MealRemovingFailedEvent,
  ProfileConfigurationFailedEvent,
  ProfileConfiguredSuccessfullyEvent,
  ProfileLoadedEvent,
  RemoveMealAction,
} from './domain.state-models';
import {Injectable} from '@angular/core';
import {ProfileService} from '../../service/profile.service';
import {catchError, map, of} from 'rxjs';
import {IDish, IFood, IMeal, IProfile} from '../../commons/models/domain.models';
import {emptyPfcc, IPfcc} from '../../commons/models/common.models';
import {isOnCurrentWeek, isToday, sumPfccs} from '../../commons/functions';
import {DateTime} from 'luxon';

export const DOMAIN_STATE_NAME = 'domain';

@State<IDomainState>({
  name: DOMAIN_STATE_NAME,
  defaults: {
    profile: null,
    dishes: [],
    foods: [],
    meals: [],
  },
})
@Injectable()
export class DomainState {

  constructor(private service: ProfileService) {
  }

  @Selector()
  static profile(state: IDomainState) {
    return state.profile;
  }

  @Selector()
  static dishes(state: IDomainState) {
    return state.dishes;
  }

  @Selector()
  static foods(state: IDomainState) {
    return state.foods;
  }

  @Selector()
  static meals(state: IDomainState) {
    return state.meals;
  }

  @Selector()
  static foodsMap(state: IDomainState): Map<number, IFood> {
    const result = new Map<number, IFood>();
    state.foods.forEach(f => result.set(f.id, f));
    return result;
  }

  @Selector()
  static dishesMap(state: IDomainState): Map<number, IDish> {
    const result = new Map<number, IDish>();
    state.dishes.forEach(d => result.set(d.id, d));
    return result;
  }

  @Selector()
  static todayNutrients(state: IDomainState): IPfcc {
    const eaten = state.meals
      .filter(m => isToday(m.eatenOn))
      .map(m => m.pfcc);

    if (state.profile?.base != null) {
      eaten.push(state.profile?.base);
    }

    return sumPfccs(...eaten);
  }

  @Selector()
  static weeklyNutrients(state: IDomainState): IPfcc {
    const eaten = state.meals
      .filter(m => isOnCurrentWeek(m.eatenOn))
      .map(m => m.pfcc);

    if (state.profile?.base != null) {
      for (let i = 0; i <= DateTime.now().weekday; i++) {
        eaten.push(state.profile?.base);
      }
    }

    return sumPfccs(...eaten);
  }

  @Selector()
  static todayMeals(state: IDomainState): IMeal[] {
    return state.meals
      .filter(m => isToday(m.eatenOn));
  }

  @Action(ProfileLoadedEvent)
  handleSuccessfulSignIn(ctx: StateContext<IDomainState>, action: ProfileLoadedEvent) {
    ctx.setState({
      profile: {
        ...action.profile,
      },
      meals: action.profile.meals,
      dishes: action.profile.dishes,
      foods: action.profile.foods,
    });
  }

  @Action(ConfigureProfileAction)
  configureProfile(ctx: StateContext<IDomainState>, action: ConfigureProfileAction) {
    return this.service.configureProfile(action.aims, action.base || null)
      .pipe(
        map(_ => new ProfileConfiguredSuccessfullyEvent(action.aims, action.base || null)),
        catchError(err => of(new ProfileConfigurationFailedEvent(err.message))),
        map(ctx.dispatch),
      );
  }

  @Action(ProfileConfiguredSuccessfullyEvent)
  handleProfileConfiguredSuccessfullyEvent(ctx: StateContext<IDomainState>, action: ProfileConfiguredSuccessfullyEvent) {
    const profile = ctx.getState().profile as IProfile;
    ctx.patchState({
      profile: {
        ...profile,
        profileConfigured: true,
        aims: action.aims,
        base: action.base,
      },
    });
  }

  @Action(ProfileConfigurationFailedEvent)
  handleProfileConfiguringFailed(ctx: StateContext<IDomainState>, action: ProfileConfigurationFailedEvent) {
    ctx.patchState({
      profile: {
        ...ctx.getState().profile as IProfile,
        profileConfigured: false,
        aims: emptyPfcc,
        base: null,
      },
    });
  }

  @Action(RemoveMealAction)
  handleRemoveMealAction(ctx: StateContext<IDomainState>, action: RemoveMealAction) {
    return this.service.removeMeal(action.mealId).pipe(
      map(_ => new MealRemovedSuccessfullyEvent(action.mealId)),
      catchError(err => of(new MealRemovingFailedEvent(action.mealId, err.message))),
      map(ctx.dispatch),
    );
  }

  @Action(MealRemovedSuccessfullyEvent)
  handleMealRemovedEvent(ctx: StateContext<IDomainState>, action: MealRemovedSuccessfullyEvent) {
    ctx.patchState({
      meals: ctx.getState().meals.filter(m => m.id !== action.mealId),
    });
  }

  @Action(MealRemovingFailedEvent)
  handleMealRemovingFailed(ctx: StateContext<IDomainState>, action: MealRemovingFailedEvent) {
    console.log(`Failed to remove meal, reason: ${action.msg}`);
  }
}

import {Injectable} from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class LocalStoreService {
  private readonly JWT_KEY = 'jwt';

  constructor() {
  }

  loadJwtToken(): string | null {
    return localStorage.getItem(this.JWT_KEY);
  }

  saveJwtToken(token: string) {
    localStorage.setItem(this.JWT_KEY, token);
  }

  dropJwtToken() {
    localStorage.removeItem(this.JWT_KEY);
  }
}

